import React from 'react';
import './InputField.css';
const STYLES = ['input--credentials'];

export const InputField = ({buttonStyle, type, placeholder, name, value, onChange}) => {
    const checkInputStyle = STYLES.includes(type) ? type : STYLES[0];

    return (
        <input 
          type={type} 
          placeholder={placeholder} 
          name={name} value={value} 
          onChange={onChange} 
          buttonStyle={`input ${checkInputStyle}`}/>
    )
}
